  false,\n\t\"url\": null,\n\t\"notes\": \"The spreadsheet in this bundle contains
  the GeothermalAreaTemplate spreadsheet that specifies specifies content elements
  for an interchange format for geothermal area polygons, for low or high temperature
  geothermal fields.  A personal geodatabase/access database is also included and
  contains the attributes in this (Template) that will become XML elements in interchange
  documents for Web feature services, served by AASG geothermal data web services.
  \ In the geothermal data system, geothermal area services may be used to discover
  resources.  The deliverable is the personal geodatabase.\",\n\t\"license_title\":
